import React, {useState} from "react"
import NavBar from "./components/NavBar"
import {BrowserRouter as Router,Switch,Route} from "react-router-dom"
import './App.css';

function App() {


  return (
    <>
      <Router>

        <NavBar/> 
        <Switch>
          <Route path="/" />
        </Switch>

      </Router>

    </>
  )
}

export default App;
